	<script>
		$(document).ready(function () {
			const mainHtml = $("#main").html();
			const parsedHtml = mainHtml.replace(/\[(.*?)\/(.*?)\]/g, '<span class="front">$1</span><span style="display:none" class="back">$2</span>'); 
			$("#main").html(parsedHtml);

			$(document).on('click','.front', function() {
				const $front = $(this);
				$front.hide();
				const $back = $front.next();
				$back.show();
			});
		});
	</script>	
